import React,{Component} from 'react';
import Table from 'react-bootstrap/Table'
import './App.css';

class App extends Component {
   data = [];
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.data = data;
    })
    .catch(console.log)
  }
  render() {
   const groupList = Object.keys(this.data).map((key) => {
       return  (
           <div key={key}>
              <div>{key}</div>
           </div>
       )
   });

   return (
     <div>{groupList}</div>
   )
  }
}

export default App;
